Самое верхнее звено пищевой цепи. А поесть я люблю! Дурная голова (я в нее ем) иногда рукам покоя не дает, тогда становится действительно страшно.
Вечно хочу спать!

FAQ - КОГО Я ДОБАВЛЯЮ В СВОИ ДРУЗЬЯ?
1. ВСЕХ одноклассников и сокурсников, с которыми я имел честь учиться в далеком детстве и юности, несмотря на то, как мы тогда относились друг к другу;
2. Тех, c кем я общаюсь теперь или в недавнем прошлом а также коллег по нынешней и предыдущим работам. Но не всех, просьба на отказы не обижаться;
3. Людей, общение с которыми мне интересно. И просто симпатичных мне личностей;
4. Ну и конечно, всех своих близких и дальних родственников.
5. Если мы с Вами лично не знакомы, но Вы желаете видеть меня в списке своих друзей, сообщите пожалуйста о причине этого желания. Заранее приношу свои извинения, но запросы о дружбе от незнакомых мне людей без этого дополнения я игнорирую.
